    /** @param {HTMLInputElement} btnUploadImage @param {MouseEvent} _ @returns {Promise<void>}*/
    #uploadImageAsync(btnUploadImage){
        let bindThis = this;
        let task = new Promise(function(onDone, onFailed){
            try {
                /** @type {HTMLElement} */
                let popupBackdrop = btnUploadImage.closest(".popup-backdrop");
                let canvPreviewImage = popupBackdrop.querySelector(".canv-preview-image");
                //clear all
                bindThis.#currentImage = null;
                let newCanv = canvPreviewImage.cloneNode(true);
                canvPreviewImage.parentNode.replaceChild(newCanv, canvPreviewImage);
                /** @type {HTMLCanvasElement} */
                let canv = newCanv;
                canv.width = canv.clientWidth;
                canv.height = canv.clientHeight;
                //load image
                let img = new Image();
                let taskLoadImg = new Promise(function(onDone){
                    img.src = URL.createObjectURL(btnUploadImage.files[0]);
                    img.onload = onDone;
                    img.onerror = function(ev){
                        throw ev;
                    }
                });
                //add observer (stop loop after exit)
                let isPlaying = true;
                let observer = new MutationObserver(function (mutations) {
                    if(canv.offsetParent == null){
                        //dispose scene!!!
                        isPlaying = false;
                        observer.disconnect();
                    }
                });
                observer.observe(document, { attributes: true, childList: true, characterData: true, subtree:true });
                //render canvas (won't be triggered if img.src is not valid)
                taskLoadImg.then(function(){
                    let stampImg = new StampImage();
                    stampImg.dataUrl = img.src;
                    stampImg.naturalWidth = img.naturalWidth;
                    stampImg.naturalHeight = img.naturalHeight;
                    stampImg.width = img.naturalWidth;
                    stampImg.height = img.naturalHeight;
                    stampImg.rotation = 0;
                    bindThis.#currentImage = stampImg;
                    bindThis.#bcAddImage.postMessage(stampImg);
                    /** @type {HTMLInputElement} */
                    let txtImageWidth = popupBackdrop.querySelector(".txt-image-width");
                    txtImageWidth.value = stampImg.width;
                    /** @type {HTMLInputElement} */
                    let txtImageHeight = popupBackdrop.querySelector(".txt-image-height");
                    txtImageHeight.value = stampImg.height;
                    /** @type {HTMLInputElement} */
                    let txtImageRotation = popupBackdrop.querySelector(".txt-image-rotation");
                    txtImageRotation.value = stampImg.rotation;
                    let loop = function(){
                        if(isPlaying){
                            let ctx = canv.getContext("2d");
                            ctx.save();
                            ctx.clearRect(0,0,360,360);
                            let center = {x:canv.clientWidth/2, y:canv.clientHeight/2};
                            ctx.translate(center.x, center.y);
                            ctx.rotate(degreeToRadian(stampImg.rotation));
                            ctx.drawImage(img, 0, 0, stampImg.naturalWidth, stampImg.naturalHeight, -stampImg.width/2, -stampImg.height/2, stampImg.width, stampImg.height);
                            ctx.rotate(degreeToRadian(-stampImg.rotation));
                            ctx.restore();
                            requestAnimationFrame(loop);
                        }
                    };
                    loop();
                    onDone();
                });
            } catch(ex) {
                console.log(ex);
                onFailed(ex);
            }
        });
        return task;
    };

