function radianToDegree(rad) {
    let pi = Math.PI;
    return rad * (180 / pi);
};
function degreeToRadian(deg) {
    let pi = Math.PI;
    return deg * (pi / 180);
};
function distanceBetweenTwoPoints(x0, y0, x1, y1){
    let distance = (x0 - x1)**2 + (y0 - y1)**2;
    distance = Math.sqrt(distance);
    return distance;
};
/** @param {number} x0  @param {number} y0 @param {number} x1 @param {number} y1*/
function degreeFromCoordinate(x0, y0, x1, y1){
    let theta = 0;
    if(x0 == x1){
        
    } else if(y0 == y1){
        theta = degreeToRadian(90);
    } else {
        let direction = {
            upper: {x: 0, y:0},
            lower: {x: 0, y:0},
        };
        if(y0 > y1){ // y get higher when getting closer to the bottom of screen
            direction.lower.x = x0;
            direction.lower.y = y0;
            direction.upper.x = x1;
            direction.upper.y = y1;
        } else {
            direction.lower.x = x1;
            direction.lower.y = y1;
            direction.upper.x = x0;
            direction.upper.y = y0;
        }
        let distance = distanceBetweenTwoPoints(x0, y0, x1, y1);
        let height = Math.abs(y1 - y0);
        theta = Math.asin(height/distance);
        if(direction.upper.x < direction.lower.x){
            theta = theta * -1;
        }
    }
    return radianToDegree(theta);
};
/**@param {{x:number,y:number}} m @param {{A:{x:number,y:number},B:{x:number,y:number},C:{x:number,y:number},D:{x:number,y:number}}} r */
function isPointInRectangle(m, r) {
    var AB = vector(r.A, r.B);
    var AM = vector(r.A, m);
    var BC = vector(r.B, r.C);
    var BM = vector(r.B, m);
    var dotABAM = dot(AB, AM);
    var dotABAB = dot(AB, AB);
    var dotBCBM = dot(BC, BM);
    var dotBCBC = dot(BC, BC);
    return 0 <= dotABAM && dotABAM <= dotABAB && 0 <= dotBCBM && dotBCBM <= dotBCBC;
};
function vector(p1, p2) {
    return {
        x: (p2.x - p1.x),
        y: (p2.y - p1.y)
    };
};
function dot(u, v) {
    return u.x * v.x + u.y * v.y;
};